import React from 'react';
import './Signup.css';
class Signup extends React.Component{
  constructor(props){
    super(props);
    this.state={
      Username: '',
      Password:'',
      Password_Confimation:'',
      Email:'',
      Address:''
      
    };
    this.onHandleChang=this.onHandleChang.bind(this);
    this.onHandleSubmit=this.onHandleSubmit.bind(this);

  }
  onHandleChang(event)
  {
    var target=event.target;
    var name = target.name;
    var value=target.value;
    this.setState({
      [name] :value,
    });
  }
  onHandleSubmit(event)
  {
    event.preventDefault();
    console.log(this.state);
  }
 
 render(){
   
  return (
    <div>
     <div className="container mt-30">        
          <div className="col-xs-10 col-sm-10 col-md-10 col-lg-10" style={{paddingTop:"20px"}}>
              
              
              <div className="row">
                <div style = {{paddingLeft:"240px"}}>
                  <h1 className="labelSignUp" style={{paddingLeft:"55px"}}>Sign Up</h1>
                  <h5 className="h5SignUp">
                      Don't have an account yet? &nbsp;
                      <a href="#">Sign Up !</a>
                  </h5>
                </div>
              </div>
              
              
                
              <div className="row">
                <div className="col-xs-4 col-sm-4 col-md-4 col-lg-4">
                   
                   <div >
                     <label >Username: </label>
                     <input type="text" className="form-control" name="Username"  onChange={this.onHandleChang} placeholder="UserName"/>
                     <br/>
                   </div>
                   <div className="form-group">
                     <label >Email: </label>
                     <input type="text" className="form-control" name="Email" onChange={this.onHandleChang} placeholder="Email" />
                   </div>
                   <div className="form-group">
                     <label >Address: </label>
                     <input type="text" className="form-control" name="Address" onChange={this.onHandleChang} placeholder="Address"/>
                   </div>
                 
                   <div className="form-group">
                     <label >Password: </label>
                     <input type="password" className="form-control" name="Password" onChange={this.onHandleChang} placeholder="Password"/>
                   </div>
                   <div className="form-group">
                     <label >Password Confimation: </label>
                     <input type="password" className="form-control" name="Password_Confimation" onChange={this.onHandleChang} placeholder="Password Confimation"/>
                   </div>
                   
                   <button  style={{marginLeft:"300px"}}type="submit" className="btn btn-primary" >Register</button>
             </div>
             
             
             
             <div className="col-xs-1 col-sm-1 col-md-1 col-lg-1">
             <hr style={{width:"1px",height:"320px",backgroundColor:"#DCDCDC"}}></hr>
             </div>
             
             <div className="col-xs-4 col-sm-4 col-md-4 col-lg-4" style={{marginTop:"90px"}}>
                <div style={{marginBottom:"20px",fontSize:"30px"}}>
                   <div style={{float:"left",color:"#0000CD"}}className="iconFB"><i className="fab fa-facebook-square"></i></div>
                   <button style={{marginLeft:"10px",fontSize:"13px"}}type="button" className="btn btn-sm btn-primary">Continue with Facebook</button>
               </div>
               
               <div  style={{marginTop:"30px",fontSize:"30px"}}>
                 
                 <img style={{width:"11%"}} src="https://yt3.ggpht.com/a/AGF-l7-BBIcC888A2qYc3rB44rST01IEYDG3uzbU_A=s900-c-k-c0xffffffff-no-rj-mo" />
                 
                 <button type="button" className="btn btn-primary" style={{marginLeft:"10px",fontSize:"13px"}}>Continue with Google</button>
               </div>
               
               </div>
          </div>
                
          

      
     </div>
  
     </div>
    </div>
  
       
  );
  }
}


export default Signup;
